class Solution:
    def maxOperations(self, s: str) -> int:
        n=len(s)
        cnt=0
        ans=0
        i=n-1
        while(i>=0):
            if(s[i]=='1'):
                ans+=cnt
                i-=1
            else:
                while(i>=0 and s[i]=='0'):i-=1
                cnt+=1
        return ans
